import {LOGIN_TRUE} from "../constants/isLoginConstants";
import {LOGIN_FALSE} from "../constants/isLoginConstants";

export const loginTrue = (data) => {
    return {
        type: LOGIN_TRUE,
        login: data.login,
        token: data.token,
        password: data.password
    }
};

export const loginFalse = () => {
  return {
      type: LOGIN_FALSE
  }
};
